            "titleMap": [
                {
                    "value": "all",
                    "name": "All items"
                },
                {
                    "value": "include",
                    "name": "Include items"
                },
                                {
                    "value": "exclude",
                    "name": "Exclude items"
                }
            ]
        },
        {
            "key": "filter",
            "type": "rc-select",
            "condition": "model.filterType !== 'all'",
            "tags": true,
            "placeholder": "Enter urls to filter",
            "items": [{"value": "/devices", "label": "/devices"}, {"value": "/assets", "label": "/assets"}, {"value": "/deviceProfies", "label": "/deviceProfies"}]
        }
    ]
}

